import {Component} from 'react'
import './index.css'

class LoginPage extends Component {
  render() {
    return (
      <div className="login-page-bg-container">
        <form className="login-form-container">
          <h1 className="login-heading">Login</h1>
        </form>
      </div>
    )
  }
}

export default LoginPage
